import React from "react";

const Header = () => {
  return (
    <header className="align-items-center">
      <div className="container-fluid">
        <h1 className="text-center">Hello</h1> <br />
        <h2 className="text-center">welcome to my portfolio</h2>
      </div>
    </header>
  );
};

export default Header;
